import React from 'react';
//import Navbar from 'react-bootstrap/Navbar'
import Navbar from 'react-bootstrap/Navbar'


class MyNavbar extends React.Component{
    render() {
        return (
           <Navbar>
            <Navbar.Header>
              <Navbar.Brand>
                <a href="#home">My Brand</a>
              </Navbar.Brand>
            </Navbar.Header>

          </Navbar>
        );
    }
}

export default MyNavbar;
